pred_sql:
SELECT sr.student_id, COUNT(sr.course_id) AS registered_courses_count
FROM Student_Course_Registrations sr
GROUP BY sr.student_id;

SELECT COUNT(*) AS number_of_days
FROM weather
WHERE mean_humidity > 50 AND mean_visibility_miles > 8;

SELECT cc.catalog_entry_name, cc.capacity 
FROM Catalog_Contents cc 
WHERE cc.price_in_dollars > 700;

SELECT COUNT(*) AS number_of_customers_without_account
FROM Customers
WHERE customer_id NOT IN (SELECT customer_id FROM Accounts);

SELECT DISTINCT c.customer_first_name, c.customer_last_name 
FROM Customers c 
JOIN Accounts a ON c.customer_id = a.customer_id;

SELECT customer_id, COUNT(card_id) AS number_of_cards
FROM Customers_Cards
GROUP BY customer_id;

SELECT card_type_code, COUNT(card_id) AS number_of_cards
FROM Customers_Cards
GROUP BY card_type_code;

SELECT card_type_code, COUNT(DISTINCT customer_id) AS number_of_customers
FROM Customers_Cards
GROUP BY card_type_code;

SELECT AVG(CAST(RAM_MiB AS INTEGER)) AS average_ram_mib
FROM chip_model
WHERE Model_name NOT IN (SELECT DISTINCT chip_model FROM phone);

SELECT booking_status_code, COUNT(apt_booking_id) AS number_of_bookings
FROM Apartment_Bookings
GROUP BY booking_status_code;

SELECT apt_type_code, MAX(room_count) AS max_rooms, MIN(room_count) AS min_rooms
FROM Apartments
GROUP BY apt_type_code;

SELECT COUNT(DISTINCT teaches.ID) AS total_instructors
FROM teaches
WHERE teaches.semester = 'Spring' AND teaches.year = '2010';

SELECT Invoices.invoice_date, Orders.order_id, Orders.order_details 
FROM Invoices 
JOIN Orders ON Invoices.order_id = Orders.order_id;

SELECT COUNT(*) AS num_users_without_reviews
FROM useracct
WHERE u_id NOT IN (SELECT DISTINCT u_id FROM review);

SELECT DISTINCT p1.Residence
FROM player p1, player p2
WHERE p1.Gender = 'M' AND p2.Gender = 'F' AND p1.Residence = p2.Residence;

SELECT ch.document_id, COUNT(DISTINCT ch.employee_id) AS employee_count
FROM Circulation_History ch
GROUP BY ch.document_id;

SELECT SUM(Number_Deaths) AS Total_Deaths, SUM(Damage_millions_USD) AS Total_Damage
FROM storm
WHERE Max_speed > (SELECT AVG(Max_speed) FROM storm);

SELECT DISTINCT c.cust_name, c.credit_score 
FROM customer c 
JOIN loan l ON c.cust_ID = l.cust_ID;

SELECT maintenance_contract_id, COUNT(asset_id) AS asset_count
FROM Assets
GROUP BY maintenance_contract_id;

SELECT Staff.staff_id, Staff.staff_name 
FROM Staff 
WHERE Staff.staff_id NOT IN (
    SELECT Engineer_Visits.contact_staff_id 
    FROM Engineer_Visits
) 
AND Staff.staff_id IN (
    SELECT Fault_Log.recorded_by_staff_id 
    FROM Fault_Log
);

SELECT COUNT(*) AS class_count 
FROM CLASS 
WHERE PROF_NUM IN (SELECT EMP_NUM FROM EMPLOYEE WHERE EMP_LNAME = 'Graztevski');

SELECT AVG(CAST(Num_of_Factories AS INTEGER)) AS Average_Factories
FROM manufacturer
WHERE CAST(Num_of_Shops AS INTEGER) > 20;

SELECT employees.FIRST_NAME, departments.DEPARTMENT_NAME 
FROM employees 
JOIN departments ON employees.DEPARTMENT_ID = departments.DEPARTMENT_ID;

SELECT JOB_TITLE, (MAX_SALARY - MIN_SALARY) AS SALARY_DIFFERENCE 
FROM jobs 
WHERE MAX_SALARY BETWEEN 12000 AND 18000;

SELECT DISTINCT d.DEPARTMENT_NAME 
FROM departments d 
JOIN employees e ON d.DEPARTMENT_ID = e.DEPARTMENT_ID;

SELECT departments.DEPARTMENT_NAME, locations.CITY, locations.STATE_PROVINCE 
FROM departments 
JOIN locations ON departments.LOCATION_ID = locations.LOCATION_ID;

SELECT COUNT(*) AS player_count 
FROM player 
WHERE birth_country = 'USA' AND bats = 'R';

SELECT Time_of_day, COUNT(Program_ID) AS Program_Count
FROM broadcast
GROUP BY Time_of_day;

SELECT COUNT(DISTINCT b.Program_ID) AS Number_of_Programs
FROM broadcast b
WHERE b.Time_of_day LIKE 'Night%';

SELECT DISTINCT ca.personal_name
FROM Course_Authors_and_Tutors ca
JOIN Students s ON ca.personal_name = s.personal_name;

SELECT Claim_ID, COUNT(Settlement_ID) AS Number_of_Settlements
FROM Settlements
GROUP BY Claim_ID;

SELECT Room.BlockFloor, COUNT(Room.RoomNumber) AS NumberOfRooms
FROM Room
GROUP BY Room.BlockFloor;

SELECT Room.BlockCode, COUNT(Room.RoomNumber) AS RoomCount
FROM Room
GROUP BY Room.BlockCode;

SELECT DISTINCT Nurse.Name 
FROM Nurse 
JOIN Undergoes ON Nurse.EmployeeID = Undergoes.AssistingNurse;

SELECT Grade, COUNT(DISTINCT Classroom) AS NumberOfClassrooms, COUNT(LastName) AS TotalStudents
FROM list
GROUP BY Grade;

SELECT dl.Location_Code, COUNT(dl.Document_ID) AS Number_of_Documents
FROM Document_Locations dl
GROUP BY dl.Location_Code;

SELECT d.Destroyed_by_Employee_ID, COUNT(d.Document_ID) AS Number_of_Documents_Destroyed
FROM Documents_to_be_Destroyed d
GROUP BY d.Destroyed_by_Employee_ID;

SELECT Product_Type_Code, COUNT(Product_ID) AS Number_of_Products
FROM Products
GROUP BY Product_Type_Code;

SELECT premises_type, COUNT(premise_id) AS number_of_premises
FROM Premises
GROUP BY premises_type;

SELECT DISTINCT product_category, COUNT(mailshot_id) AS mailshot_count 
FROM Mailshot_Campaigns 
GROUP BY product_category;

SELECT outcome_code, COUNT(mailshot_id) AS number_of_mailshots
FROM Mailshot_Customers
GROUP BY outcome_code;

SELECT P.premises_type, CA.address_type_code 
FROM Customer_Addresses CA 
JOIN Premises P ON CA.premise_id = P.premise_id;

SELECT Things.thing_id, Things.Type_of_Thing_Code, Organizations.organization_details 
FROM Things 
JOIN Organizations ON Things.organization_id = Organizations.organization_id;

SELECT SUM(City_Population) AS Total_Population
FROM district
WHERE City_Area > (SELECT AVG(City_Area) FROM district);

SELECT COUNT(DISTINCT v1.SongId) AS SharedVocalCount
FROM Vocals v1
JOIN Vocals v2 ON v1.SongId = v2.SongId AND v1.Bandmate != v2.Bandmate;

SELECT MIN(membership_amount) AS Min_Memberships, MAX(membership_amount) AS Max_Memberships 
FROM branch 
WHERE Open_year = 2011 OR City = 'London';

SELECT COUNT(*) AS unused_color_count
FROM Ref_Colors
WHERE color_code NOT IN (
    SELECT DISTINCT color_code
    FROM Products
);

SELECT train.Name AS Train_Name, railway.Location AS Railway_Location
FROM train
JOIN railway ON train.Railway_ID = railway.Railway_ID;

SELECT COUNT(DISTINCT d.dormid) AS number_of_dorms_with_amenities
FROM Dorm d
JOIN Has_amenity ha ON d.dormid = ha.dormid;

SELECT AVG(amount_of_transaction) AS average_transaction_amount 
FROM Transactions 
WHERE transaction_type_code = 'SALE';

SELECT investor_id, AVG(amount_of_transaction) AS average_transaction_amount
FROM Transactions
GROUP BY investor_id;

SELECT How_to_Get_There, COUNT(Tourist_Attraction_ID) AS Number_of_Attractions
FROM Tourist_Attractions
GROUP BY How_to_Get_There;

SELECT DISTINCT Individuals.individual_last_name 
FROM Organization_Contact_Individuals 
JOIN Individuals ON Organization_Contact_Individuals.individual_id = Individuals.individual_id;

SELECT Statements.Statement_ID, Statements.Statement_Details, Accounts.Account_Details 
FROM Statements 
JOIN Accounts ON Statements.Statement_ID = Accounts.Statement_ID;

SELECT Project_ID, COUNT(Document_ID) AS Number_of_Documents
FROM Documents
GROUP BY Project_ID;

SELECT Document_Type_Code, COUNT(Document_ID) AS Document_Count
FROM Documents
GROUP BY Document_Type_Code;

SELECT COUNT(*) AS number_of_customers_without_payments
FROM Customers
WHERE customer_id NOT IN (
    SELECT customer_id
    FROM Customer_Payments
);

SELECT DISTINCT Staff.last_name 
FROM Staff 
JOIN Customers ON Staff.last_name = Customers.last_name;

SELECT Building, COUNT(FacID) AS NumberOfFacultyMembers
FROM Faculty
GROUP BY Building;

SELECT Rank, Sex, COUNT(*) as Count
FROM Faculty
GROUP BY Rank, Sex;

SELECT Has_Pet.StuID, COUNT(Has_Pet.PetID) AS PetCount
FROM Has_Pet
GROUP BY Has_Pet.StuID;

SELECT Documents.Document_Name, Documents.Template_ID 
FROM Documents 
WHERE Documents.Document_Description LIKE '%w%';

SELECT COUNT(DISTINCT Departments.department_id) AS department_count
FROM Departments
JOIN Degree_Programs ON Departments.department_id = Degree_Programs.department_id;

SELECT MAX(Final_Table_Made) AS Max_Final_Tables
FROM poker_player
WHERE Earnings < 200000;

SELECT DISTINCT Owners.state
FROM Owners
JOIN Professionals ON Owners.state = Professionals.state;

SELECT Treatments.date_of_treatment, Professionals.first_name 
FROM Treatments 
JOIN Professionals ON Treatments.professional_id = Professionals.professional_id;

SELECT Treatments.cost_of_treatment, Treatment_Types.treatment_type_description 
FROM Treatments 
JOIN Treatment_Types ON Treatments.treatment_type_code = Treatment_Types.treatment_type_code;

SELECT COUNT(*) AS professionals_without_treatments
FROM Professionals
WHERE professional_id NOT IN (
    SELECT DISTINCT professional_id
    FROM Treatments
);

SELECT DISTINCT Citizenship, MAX(Net_Worth_Millions) AS Max_Net_Worth
FROM singer
GROUP BY Citizenship;
